script: |
  super -f text -I q9084.spq | sort > q9084.out

inputs:
  - name: q9084.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE ( col2 ) NOT BETWEEN + col0 AND + + col2 / CAST ( NULL AS INTEGER ) * - + ( col2 ) + - col2 * - col2 * - + col2;
  - name: tab0

outputs:
  - name: q9084.out
    data: |
      87	21	10
